import * as api from '../api';

// Action Creators
export const getSchools = () => async (dispatch) => {
  try {
    const { data } = await api.fetchSchools();
    console.log(data);
    dispatch({ type: 'FETCH_ALL', payload: data });
  }
  catch (error) {
    console.log(error.message);

  }
  const action = { type: 'FETCH_ALL'}
}
